import React, { Component } from 'react';

import { Link } from 'react-router-dom';

import Navbar from './Navbar';

import blank1099 from '../images/blank1099.png'; // local 1099

class Preview extends Component {

  render() {
    return (
        <div style={{textAlign:'center', backgroundColor:'rgb(225,230,235)', minHeight:'100vh'}}>

        	<Navbar/>

        	<br/>
        	<br/>

        	<div className='container'>
        	<div className='row'>
        	<div className='col-sm-8 offset-sm-2'>
	        	<div style={{backgroundColor:'white', borderRadius:'40px'}}>
	        		<br/>

	        		<img src={blank1099} style={{width:'80%'}} alt="..." />

	         	</div>
         	</div>
         	</div>
         	</div>

         	<br/>
         	<br/>

        </div>
    );
  }

}

export default Preview;
